    data: employeeArray,
    [Symbol.iterator]() {
      let index = 0;
      return {
        next: () => {
          if (index < this.data.length) {
            index += 1;
            return ({ value: this.data[index - 1], done: false });
          }
          return ({ value: undefined, done: true });
        },
      };
    },
  };
}

